  \"2016-04-23T02:37:42.375649\",\n\t\"name\": \"transstructures-bcvtrans\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"BCVTRANS is a statewide set of transportation
  structures, which includes all bridges inventoried by the Vermont Agency of Transportation,
  as well as some culverts. The BCVTRANS dataset is limited to State Long, State Short,
  and Town Longs structures (bridges and culverts). It does not include State Ultra-Shorts
  or Town Short structures as of 8/4/2014. NOTICE - BCVTRANS replaces the BC_VTransInventoryTable_Primary
  and BC_VTransInventoryTable_Other tables/layers previously distributed with the
  discontinued TRANSTRUC dataset. BCVTRANS does not comply with the \"VGIS Bridge
  & Culvert Data Exchange Standard\" (http://vcgi.vermont.gov/resources/standards/)
  as of 8/4/2014.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
